import HomePage from "./Pages/HomePage"
import CraftPage from "./Pages/CraftPage"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch> 
        <Route exact path="/">
            <HomePage />
        </Route>
        <Route path="/Craft">
            <CraftPage />
        </Route>
      </Switch>

    </Router>
  );
}

export default App;
